void refereshBlocks(){
  bool b_rvs_set, b_rvs_rdy, b_uu_set, b_all_rdy;
  int loc_rvs = (int)txt_rvs.text();
  b_uu_set = cbx_uu.currentIndex();
  b_rvs_set = (loc_rvs &gt; 0 &amp; loc_rvs &lt;=22);
  if(b_rvs_set){
    int mes_sts;
    dpGet(&quot;LogicRVS_&quot; + txt_rvs.text +  &quot;.STS.status_mes&quot;, mes_sts);
    b_rvs_rdy = (mes_sts == 2);
//     dpGet(&quot;LogicRVS_&quot; + txt_rvs.text +  &quot;.STS.sts_bool.taking&quot;, b_rvs_rdy);
  }else{
    b_rvs_rdy = false;
  }
  b_all_rdy = (b_rvs_set &amp; b_rvs_rdy &amp; b_uu_set);

  uu_unk.backCol  = (b_uu_set)  ? &quot;Green&quot; : &quot;Yellow&quot;;
  rvs_unk.backCol = (b_rvs_set) ? &quot;Green&quot; : &quot;Yellow&quot;;
  rvs_rdy.backCol = (b_rvs_rdy) ? &quot;Green&quot; : &quot;Yellow&quot;;
  rec_rdy.backCol = (b_all_rdy) ? &quot;Green&quot; : &quot;Yellow&quot;;

  uu_unk.text  = (b_uu_set)  ? &quot;Измерительная система определена&quot; : &quot;Измерительная система не определена&quot;;
  rvs_unk.text = (b_rvs_set) ? &quot;Резервуар опеределен&quot;             : &quot;Резервуар не определен&quot;;
  rvs_rdy.text = (b_rvs_rdy) ? &quot;Резервуар готов&quot;                  : &quot;Резервуар не готов&quot;;
  rec_rdy.text = (b_all_rdy) ? &quot;Готов к приему&quot;                   : &quot;Не готов к приему&quot;;
}

