dyn_dyn_anytype sortData(dyn_anytype vals){
  dyn_dyn_anytype result;
  for(int i=0; i&lt;4; i++){
    dyn_anytype t_post;
    for(int j=1; j&lt;=9; j++){
      dynAppend(t_post, vals[i*9+j]);
    }
    dynAppend(result, t_post);
  }
  return result;
}

string stsToText(int sts){
  string res;
  switch(sts){
    case 0x00:
      res = &quot;Ожидание&quot;;
      break;
    case 0x10:
      res = &quot;Разрешение&quot;;
      break;
    case 0x20:
      res = &quot;Налив&quot;;
      break;
    case 0x30:
      res = &quot;Пауза&quot;;
      break;
    case 0x40:
      res = &quot;Продолжение&quot;;
      break;
    case 0x60:
      res = &quot;Ошибка&quot;;
      break;
    case 0x80:
      res = &quot;Не активный&quot;;
      break;
    default:
      res = &quot;Неизвестно&quot;;
  }
  return res;
}

string stsToColor(int sts){
  string res;
  switch(sts){
    case 0x00:
      res = &quot;Grey&quot;;
      break;
    case 0x10:
      res = &quot;Yellow&quot;;
      break;
    case 0x20:
      res = &quot;Green&quot;;
      break;
    case 0x30:
      res = &quot;Yellow&quot;;
      break;
    case 0x40:
      res = &quot;Green&quot;;
      break;
    case 0x60:
      res = &quot;Red&quot;;
      break;
    case 0x80:
      res = &quot;Red&quot;;
      break;
    default:
      res = &quot;Red&quot;;
  }
  return res;
}

