void cbWorker(dyn_string dps, dyn_anytype vals){
  dyn_dyn_anytype dd_vals = sortData(vals);
  dyn_dyn_anytype dd_dps = sortData(dps);

  /*
  16 - Разрешение налива, 32 - Пуск, 48 - Пауза
  64 - Продолжение, 0 - Стоп, 96 - Ошибка, 128 - Не активный
  */
  //Кнопка Разрешение налива
  PANEL_REF2.enabled(dd_vals[1][6]  == 0);
  PANEL_REF45.enabled(dd_vals[2][6] == 0);
  PANEL_REF55.enabled(dd_vals[3][6] == 0);
  PANEL_REF52.enabled(dd_vals[4][6] == 0);
  //Кнопка Пуск
  PANEL_REF7.enabled((dd_vals[1][6]  == 16 || dd_vals[1][6] == 64));
  PANEL_REF46.enabled((dd_vals[2][6] == 16 || dd_vals[2][6] == 64));
  PANEL_REF56.enabled((dd_vals[3][6] == 16 || dd_vals[3][6] == 64));
  PANEL_REF51.enabled((dd_vals[4][6] == 16 || dd_vals[4][6] == 64));
  //Кнопка Продолжение
  PANEL_REF4.enabled(dd_vals[1][6]  == 48);
  PANEL_REF48.enabled(dd_vals[2][6] == 48);
  PANEL_REF58.enabled(dd_vals[3][6] == 48);
  PANEL_REF49.enabled(dd_vals[4][6] == 48);
  //Кнопка Пауза
  PANEL_REF3.enabled(dd_vals[1][6]  == 32);
  PANEL_REF47.enabled(dd_vals[2][6] == 32);
  PANEL_REF57.enabled(dd_vals[3][6] == 32);
  PANEL_REF50.enabled(dd_vals[4][6] == 32);
  //Кнопка Стоп
  PANEL_REF1.enabled(dd_vals[1][6]  != 0 &amp; dd_vals[1][6] != 48);
  PANEL_REF44.enabled(dd_vals[2][6] != 0 &amp; dd_vals[2][6] != 48);
  PANEL_REF54.enabled(dd_vals[3][6] != 0 &amp; dd_vals[3][6] != 48);
  PANEL_REF53.enabled(dd_vals[4][6] != 0 &amp; dd_vals[4][6] != 48);
  btn_add.enabled((dd_vals[1][6]  == 0 &amp;&amp; dd_vals[2][6] == 0 &amp;&amp; dd_vals[3][6] == 0 &amp;&amp; dd_vals[4][6] == 0 &amp;&amp; !g_mes));
  for(int i=1; i&lt;=dynlen(dd_vals); i++){
    setValue(&quot;pst&quot;+i+&quot;_sts&quot;, &quot;text&quot;, stsToText(dd_vals[i][6]));
    setValue(&quot;pst&quot;+i+&quot;_sts&quot;, &quot;backCol&quot;, stsToColor(dd_vals[i][6]));
    setValue(&quot;pst&quot;+i+&quot;_stp&quot;, &quot;text&quot;, stpToText(dd_vals[i][9]));
    sdShowValue(&quot;pst&quot;+i+&quot;_press&quot;, dd_dps[i][7], dd_vals[i][7], 1, &quot;111&quot;, 1, &quot;кг/см2&quot;);

    if(dd_vals[i][1] == 1){
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;backCol&quot;, &quot;Red&quot;);
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;text&quot;, &quot;Сработка&quot;);
    }
    else{
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;text&quot;, &quot;Норма&quot;);
    }

    if(dd_vals[i][2] == 1) {
      setValue(&quot;pst&quot;+i+&quot;_vlv&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      setValue(&quot;pst&quot;+i+&quot;_vlv&quot;, &quot;text&quot;, &quot;Открыт&quot;);
    }
    else {
      setValue(&quot;pst&quot;+i+&quot;_vlv&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);
      setValue(&quot;pst&quot;+i+&quot;_vlv&quot;, &quot;text&quot;, &quot;Закрыт&quot;);
    }

    switch(dd_vals[i][3]){ // ground status м
      case 1:
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;text&quot;, &quot;Гаражное&quot;);
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);
        break;
      case 2:
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;text&quot;, &quot;Рабочее&quot;);
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;backCol&quot;, &quot;Green&quot;);
        break;
      default:
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;text&quot;, &quot;Промежуточное&quot;);
        setValue(&quot;pst&quot;+i+&quot;_gnd&quot;, &quot;backCol&quot;, &quot;Red&quot;);
    }
    //Рукав
    if(dd_vals[i][4] &gt; 0){
      setValue(&quot;pst&quot;+i+&quot;_end&quot;, &quot;text&quot;, &quot;Подключ.&quot;);
      setValue(&quot;pst&quot;+i+&quot;_end&quot;, &quot;backCol&quot;, &quot;Green&quot;);
    }
    else {
      setValue(&quot;pst&quot;+i+&quot;_end&quot;, &quot;text&quot;, &quot;Отключ.&quot;);
      setValue(&quot;pst&quot;+i+&quot;_end&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
    }
  }
}

void cbIS(dyn_string dpe, dyn_int val) {
  setValue(&quot;is1_sts&quot;, &quot;text&quot;, stsToText(val[1]));
  setValue(&quot;is2_sts&quot;, &quot;text&quot;, stsToText(val[2]));
  setValue(&quot;is3_sts&quot;, &quot;text&quot;, stsToText(val[3]));
  setValue(&quot;is4_sts&quot;, &quot;text&quot;, stsToText(val[4]));

  setValue(&quot;is1_sts&quot;, &quot;backCol&quot;, stsToColor(val[1]));
  setValue(&quot;is2_sts&quot;, &quot;backCol&quot;, stsToColor(val[2]));
  setValue(&quot;is3_sts&quot;, &quot;backCol&quot;, stsToColor(val[3]));
  setValue(&quot;is4_sts&quot;, &quot;backCol&quot;, stsToColor(val[4]));
}

