//   txt_car.text(vals[1]);
//   cbx_fuel.currentIndex(vals[2]);
  DebugN(vals[2]);
  if(vals[2] == 1) { //ДТ-З
    post1_hide.visible(false);
    post2_hide.visible(true);
    post3_hide.visible(true);
