  }
  else if(vals[2] == 2) { //ДТ-Л
    post1_hide.visible(true);
    post2_hide.visible(false);
    post3_hide.visible(true);
    post4_hide.visible(true);
  }
  else if(vals[2] == 3) { //92
    post1_hide.visible(true);
    post2_hide.visible(true);
    post3_hide.visible(false);
    post4_hide.visible(true);
  }
  else if(vals[2] == 4) { //95
    post1_hide.visible(true);
    post2_hide.visible(true);
    post3_hide.visible(true);
    post4_hide.visible(false);
  }
  else {
    post1_hide.visible(true);
    post2_hide.visible(true);
    post3_hide.visible(true);
    post4_hide.visible(true);
  }
}

void cbAll(string dp, int fuel,
           string dp1, bool mes){
  if(fuel == 1){
    pst1_grp.visible(true);
    pst2_grp.visible(false);
    pst3_grp.visible(false);
    pst4_grp.visible(false);
  }else if(fuel == 2){
    pst1_grp.visible(false);
    pst2_grp.visible(true);
    pst3_grp.visible(false);
    pst4_grp.visible(false);
  }else if(fuel == 3){
    pst1_grp.visible(false);
    pst2_grp.visible(false);
    pst3_grp.visible(true);
    pst4_grp.visible(false);
  }else if(fuel == 4){
    pst1_grp.visible(false);
    pst2_grp.visible(false);
    pst3_grp.visible(false);
    pst4_grp.visible(true);
  }else{
    pst1_grp.visible(false);
    pst2_grp.visible(false);
    pst3_grp.visible(false);
    pst4_grp.visible(false);
  }
    cbx_uu.currentIndex(fuel);
    g_mes = mes;
    txt_car.enabled(!mes);
    txt_rvs.enabled(!mes);
    txt_fuel.enabled(!mes);
    txt_inventory.enabled(!mes);
    txt_dose.enabled(!mes);
    cbx_uu.enabled(!mes);
    cbx_mes.currentIndex((int)mes);

  if(mes){
    int cur_uu;
    dpGet(DP + &quot;.ALL.FIL_TYP&quot;, cur_uu);
    dyn_string is_dps = makeDynString(&quot;LAST_RECEIVE_1.state&quot;,
                                      &quot;LAST_RECEIVE_2.state&quot;,
                                      &quot;LAST_RECEIVE_3.state&quot;,
                                      &quot;LAST_RECEIVE_4.state&quot;);
    dyn_int is_sts;
    int is_1, is_2, is_3, is_4;
    dpGet(is_dps, is_sts);
    bool mes_act;
    for(int i=1; i&lt;=is_sts.count(); i++){
      string car, fuel, task, inventory;
      int uu, rvs;
      float dose;
      DebugN(i,is_dps[i],is_sts[i]);
      if(is_sts[i] != 2 ){
        dpGet(&quot;LAST_RECEIVE_&quot; + i + &quot;.init.&quot; + num_usn + &quot;.task&quot;, task,
              &quot;LAST_RECEIVE_&quot; + i + &quot;.init.&quot; + num_usn + &quot;.doc&quot;, inventory,
