              &quot;LAST_RECEIVE_&quot; + i + &quot;.init.&quot; + num_usn + &quot;.tank&quot;, rvs,
              &quot;LAST_RECEIVE_&quot; + i + &quot;.init.&quot; + num_usn + &quot;.weight&quot;, dose);
        if(task != &quot;&quot; &amp; task != &quot;ОПЕРАТОР&quot;){
          txt_car.text(car);
          txt_rvs.text(rvs);
          txt_fuel.text(fuel);
          txt_dose.text(dose);
          txt_task.text(task);
          txt_inventory.text(inventory);
          if(cur_uu != uu)
            dpSetWait(DP + &quot;.ALL.FIL_TYP&quot;, uu);
          mes_act = true;
          break;
        }
      }
    }
//     if(!mes_act){
//       dpSetWait(DP + &quot;.ALL.MES&quot;, 0);
//     }

  }else{
    string l_car, l_fuel, l_task, l_inventory;
    int l_uu, l_rvs;
    float l_dose;
    int l_sts;
    dpGet(&quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.task&quot;, l_task,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.doc&quot;, l_inventory,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.rail&quot;, l_car,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.fuel&quot;, l_fuel,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.uu&quot;, l_uu,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.tank&quot;, l_rvs,
          &quot;LAST_RECEIVE_&quot; + fuel + &quot;.init.&quot; + num_usn + &quot;.weight&quot;, l_dose);
      txt_car.text(l_car);
      txt_rvs.text(l_rvs);
      txt_fuel.text(l_fuel);
      txt_dose.text(l_dose);
      txt_task.text(&quot;ОПЕРАТОР&quot;);
      txt_inventory.text(l_inventory);
  }
}

void is_change(string is, string post) {
  int status_is_pst1, status_is_pst2, status_is_pst3, cur_post;
  dpGet(is + &quot;.PST_1.status&quot;, status_is_pst1,
        is + &quot;.PST_2.status&quot;, status_is_pst2,
        is + &quot;.PST_3.status&quot;, status_is_pst3,
        is + &quot;.ALL.cur_post&quot;, cur_post);
  if(cur_post == 1) {
    if(status_is_pst1 == 0) {
      ChildPanelOnCentralModal(&quot;mnemo/pos4_JD/IS_run.xml&quot;,
      &quot;Выбор измерительной системы&quot;,
      makeDynString(&quot;$dp:&quot; + is, &quot;$dp_post:&quot; + post, &quot;$dp_usn:&quot; + DP));
    }
    else {
      dpSetWait(DP + &quot;.&quot; + post + &quot;.CMD&quot;, 0x10);
    }
  }
  if(cur_post == 2) {
    if(status_is_pst2 == 0) {
      ChildPanelOnCentralModal(&quot;mnemo/pos4_JD/IS_run.xml&quot;,
      &quot;Выбор измерительной системы&quot;,
      makeDynString(&quot;$dp:&quot; + is, &quot;$dp_post:&quot; + post, &quot;$dp_usn:&quot; + DP));
    }
    dpSetWait(DP + &quot;.&quot; + post + &quot;.CMD&quot;, 0x10);
  }
  if(cur_post == 3) {
    if(status_is_pst3 == 0) {
      ChildPanelOnCentralModal(&quot;mnemo/pos4_JD/IS_run.xml&quot;,
      &quot;Выбор измерительной системы&quot;,
      makeDynString(&quot;$dp:&quot; + is, &quot;$dp_post:&quot; + post, &quot;$dp_usn:&quot; + DP));
    }
  }
  dpSetWait(DP + &quot;.&quot; + post + &quot;.CMD&quot;, 0x10);
}

void IS_start(string is) {
  int status_is_pst1, status_is_pst2, status_is_pst3, cur_post;
  dpGet(is + &quot;.PST_1.status&quot;, status_is_pst1,
        is + &quot;.PST_2.status&quot;, status_is_pst2,
        is + &quot;.PST_3.status&quot;, status_is_pst3,
        is + &quot;.ALL.cur_post&quot;, cur_post);
  if(cur_post == 1) {
    if(status_is_pst1 == 16 || status_is_pst1 == 64) {
      dpSetWait(is + &quot;.PST_1.cmd&quot;, 0x20);
    }
  }
  if(cur_post == 2) {
    if(status_is_pst2 == 16 || status_is_pst2 == 64) {
      dpSetWait(is + &quot;.PST_2.cmd&quot;, 0x20);
    }
  }
  if(cur_post == 3) {
    if(status_is_pst3 == 16 || status_is_pst3 == 64) {
      dpSetWait(is + &quot;.PST_3.cmd&quot;, 0x20);
    }
  }
}

void IS_continue(string is) {
  int status_is_pst1, status_is_pst2, status_is_pst3, cur_post;
  dpGet(is + &quot;.PST_1.status&quot;, status_is_pst1,
        is + &quot;.PST_2.status&quot;, status_is_pst2,
        is + &quot;.PST_3.status&quot;, status_is_pst3,
        is + &quot;.ALL.cur_post&quot;, cur_post);
  if(cur_post == 1) {
    if(status_is_pst1 == 48) {
      dpSetWait(is + &quot;.PST_1.cmd&quot;, 0x40);
    }
  }
  if(cur_post == 2) {
    if(status_is_pst2 == 48) {
      dpSetWait(is + &quot;.PST_2.cmd&quot;, 0x40);
    }
  }
  if(cur_post == 3) {
    if(status_is_pst3 == 48) {
      dpSetWait(is + &quot;.PST_3.cmd&quot;, 0x40);
    }
  }
}

void IS_stop(string is, string pst_usn) {
  int cur_post, cur_usn;
  dyn_int usn_on;
  dpGet(is + &quot;.ALL.cur_post&quot;, cur_post);
  dyn_string usn = makeDynString(&quot;USN_1&quot;, &quot;USN_2&quot;, &quot;USN_3&quot;, &quot;USN_4&quot;, &quot;USN_5&quot;, &quot;USN_6&quot;, &quot;USN_7&quot;, &quot;USN_8&quot;);
  cur_usn = dynContains(usn, DP);
  dynRemove(usn, cur_usn);
  for(int i = 1; i &lt;= dynlen(usn); i++) {
    int state_usn;
    dpGet(usn[i] + &quot;.&quot; + pst_usn + &quot;.STS&quot;, state_usn);
    if(state_usn == 0 || state_usn == 128)/*значит нет в работе*/ //возможно надо добавить условие по Ошибке (96)
      dynAppend(usn_on, 0);
    else if(state_usn != 0 &amp; state_usn != 128)/*значит есть в работе*/ //возможно надо добавить условие по Ошибке (96)
      dynAppend(usn_on, 1);
  }
  int in_work;
  in_work = dynContains(usn_on, 1);
  if(in_work == 0){
    if(cur_post == 1) {
      dpSetWait(is + &quot;.PST_1.cmd&quot;, 0x00);
    }
    if(cur_post == 2) {
      dpSetWait(is + &quot;.PST_2.cmd&quot;, 0x00);
    }
    if(cur_post == 3) {
      dpSetWait(is + &quot;.PST_3.cmd&quot;, 0x00);
    }
  }
}

int fuelToPost(string fuel){
  int result = 0;
  switch(fuel){
    case &quot;ДТ-З&quot;:
    case &quot;ДТЗ&quot;:
      result = 1;
      break;
    case &quot;ДТ-Л&quot;:
    case &quot;ДТЛ&quot;:
      result = 2;
      break;
    case &quot;92&quot;:
    case &quot;АИ 92&quot;:
      result = 3;
      break;
    case &quot;95&quot;:
    case &quot;АИ 95&quot;:
      result = 4;
      break;

  }
}

